import { useEffect, useState } from "react";

function StudentForm(){
    const[data,setData]=useState([])
    useEffect(()=>{
        fetch("http://localhost:3008/StudentDatabase")
        .then((res)=>{
            return res.json();
        })
        .then((resp)=>{
            console.log(resp)
            setData(resp)
        })
        
    },[])
    return(
        <div>
            
        </div>
    )
}
export default StudentForm;
